-- Table structure for chat
-- ----------------------------
DROP TABLE IF EXISTS `chat`;
CREATE TABLE `chat` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键id',
  `type` int(2) NOT NULL COMMENT '消息类型,0.聊天,1.通知',
  `content` varchar(100) NOT NULL COMMENT '消息内容',
  `sender` varchar(50) NOT NULL COMMENT '消息发送人',
  `sendTime` bigint(20) NOT NULL COMMENT '消息发送时间',
  `roomCode` varchar(10) NOT NULL COMMENT '房间号',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=5169 DEFAULT CHARSET=utf8;

